goog.provide("goog.i18n.uCharNamesTest");goog.setTestOnly("goog.i18n.uCharNamesTest");goog.require("goog.i18n.uCharNames");goog.require("goog.testing.jsunit");function testToName(){var result=goog.i18n.uCharNames.toName(" ");assertEquals("Space",result)}function testToNameForNumberKey(){var result=goog.i18n.uCharNames.toName("\u2028");assertEquals("Line Separator",result)}function testToNameForVariationSelector(){var result=goog.i18n.uCharNames.toName("\uFE00");assertEquals("Variation Selector - 1",result)}function testToNameForVariationSelectorSupp(){var result=goog.i18n.uCharNames.toName("\uDB40\uDD00");assertEquals("Variation Selector - 17",result)}function testToNameForNull(){var result=goog.i18n.uCharNames.toName("a");assertNull(result)}